import React, { Component } from 'react';

class CurrentWeather extends Component {
    constructor(props) {
        super(props);
        this.state = {

        }; 
      } 
    render() { 
   console.log(this.props.currentweather);

        return ( 

            <div className="current">
          <h2>Current Weather</h2>
                <ul>    
                <li>Main:{this.currentWeather['main']}</li>
                <li>Description:{this.currentWeather['description']}</li>
                <li>Icon:{this.currentWeather['icon']}</li>
                <li>Temp:{this.currentWeatherTemps['temp']}</li>
                <li>Feels Like:{this.currentWeatherTemps['feels_like']}</li>
                <li>Humidity:{this.currentWeatherTemps['humidity']}</li>
                <li>Wind:{this.currentWind}</li>
                <li>Sunrise: {this.sunrise}</li>
                <li>Sunset: {this.sunset}</li>
                <li></li>
                </ul>

            </div>


         );


    }
}

export default CurrentWeather;
